            //Faces
            case 'f0': //RIGHT
                phi = Math.PI * 0.5;
                theta = Math.PI * 0.5;
                break;
            case 'f1': //TOP
                phi = 0;
                theta = 0;
                break;
            case 'f2': //FRONT
                phi = Math.PI * 0.5;
                theta = 0;
                break;
            case 'f3': //LEFT
                phi = Math.PI * 0.5;
                theta = -Math.PI * 0.5;
                break;
            case 'f4': //BOTTOM
                phi = Math.PI;
                theta = 0;
                break;
            case 'f5': //BACK
                phi = Math.PI * 0.5;
                theta = Math.PI;
                break;
            //corners
